import './App.css';
import Header from './Header'
import AddContact from './AddContact'
import ContactList from './ContactList'

function App() {

  const contacts = [
    {
      id : "1",
      name : "Sant",
      email : "sant@gmail.com"
    },
    {
      id : "2",
      name : "Nikesh",
      email : "nicks@gmail.com"
    }
  ]

  return (

    <div className="ui container">



      <AddContact/>
      <ContactList contacts={contacts}/>
    </div>
   );
}

export default App;
